//后台查询前十条工程
function getTopTenProject() {
    var basePath = $("#path").val();
    //ajax查后台数据
    $.ajax({
        url: basePath + "/getTopTenProject.do",
        type: "get",
        dataType: "json",
        success: function (res) {
            // debugger
            if (res.message === "success") {
                showEchars(res.dataBody);
            }
            if (res.message === "empty"){
                layer.msg("当前无工程");
            }
            if (res.message === "error") {
                layer.msg("后台错误，请联系管理员！");
            }
        }
    });
}

//查询十条工程经纬度
function showEchars(siteArray) {
    //定义一个返回数组
    var resObj = {};
    //解析前十名工程数据
    //定义工程地点数组
    var siteNameArray = [];
    var siteNameStr = "";
    //定义经纬度数组
    var coordinate = [];
    //未查询到的工程数组
    var unSelectArray = [];
    //产量数组
    var totalArray = [];
    for (var i = 0 ;i < siteArray.length;i++){
        var siteName = siteArray[i].construction_site_name;
        if (siteName){
            siteNameArray.push(siteName);
            if (siteNameStr === ""){
                siteNameStr += siteName;
            } else {
                siteNameStr += "|" + siteName;
            }
        }
    }
    //调用高德地图查询工程经纬度
    //集中查询北京地区
    $.ajax({
        url: "https://restapi.amap.com/v3/geocode/geo",
        type: "get",
        async: false,
        data:{
            'city':'beijing',
            'key':'3c2dbf98d968e2a3a458237529dd6ea0',
            'batch':true,
            'address':siteNameStr
        },
        dataType: "json",
        success: function (res) {
            var tem = JSON.parse(JSON.stringify(res));
            if (res.status === '0') {
                console.log("查询地址信息失败，失败原因" + res.info);
                return
            }
            //特殊的几个
            resObj['路驰分公司'] = [116.360115,39.701526];
            // resObj['北京市政路桥建材集团'] = [116.454483,39.834912];
            // resObj['天安门'] = [116.404413,39.91433];
            var geoArray = res.geocodes;

            for (var i = 0; i < geoArray.length;i++){
                var contion = geoArray[i].formatted_address;
                if(!isBlank(contion)){
                    // coordinate.push(geoArray[i].location);
                    var temArray = [];
                    var temStr = geoArray[i].location;
                    var lo = parseFloat(temStr.split(",")[0]);
                    var lat = parseFloat(temStr.split(",")[1]);
                    temArray.push(lo);
                    temArray.push(lat);
                    var projectName = siteArray[i].project_name;
                    var total = siteArray[i].total;
                    totalArray.push(total);
                    if (projectName.indexOf("(") >= 0) {
                        projectName = projectName.split("(")[0];
                    }
                    if (projectName.indexOf("（") >= 0) {
                        projectName = projectName.split("（")[0];
                    }
                    if (resObj[projectName]){
                        var twoProName = projectName + "_";
                        resObj[twoProName] = temArray;
                    } else {
                        resObj[projectName] = temArray;
                    }

                }else {
                    var obj = {};
                    var proName = siteArray[i].project_name;
                    if (proName.indexOf("(") >= 0) {
                        proName = proName.split("(")[0];
                    }
                    if (proName.indexOf("（") >= 0) {
                        proName = proName.split("（")[0];
                    }
                    if (proName.indexOf("廊坊") >= 0 || proName.indexOf("保定") >= 0 ){
                        obj.location = proName.indexOf("廊坊") >= 0? "廊坊":"保定";
                        obj.proName = proName;
                        obj.siteName = siteNameArray[i];
                        obj.total = siteArray[i].total;
                        unSelectArray.push(obj);
                        continue
                    }
                    obj.location = "";
                    obj.siteName = siteNameArray[i];
                    unSelectArray.push(obj);
                }
            }
        }
    });

    for (var j = 0; j < unSelectArray.length;j++){
        var location = unSelectArray[j].location;
        var proName = unSelectArray[j].proName;
        var site = unSelectArray[j].siteName;
        var total = unSelectArray[j].total;
        totalArray.push(total);

        //再次查询未查询到的数据,
        $.ajax({
            url: "https://restapi.amap.com/v3/geocode/geo",
            async: false,
            type: "get",
            data:{
                'city':location,
                'key':'3c2dbf98d968e2a3a458237529dd6ea0',
                'address':site
            },
            dataType: "json",
            success: function (res) {
                if (res.status === '0') {
                    console.log("查询地址信息失败，失败原因" + res.info);
                    return
                }
                var geoArray = res.geocodes;
                for (var i = 0; i < geoArray.length;i++){
                    if(geoArray[i].formatted_address){
                        var temArray = [];
                        var temStr = geoArray[i].location;
                        var lo = parseFloat(temStr.split(",")[0]);
                        var lat = parseFloat(temStr.split(",")[1]);
                        temArray.push(lo);
                        temArray.push(lat);
                        resObj[proName] = temArray;
                    }
                }
            }
        });
    }
    //定义地图参数二
    var BJData = [];
    var colourArry = ['#ffdfba','#e87a00','#0cd402','#efa900','#f4f513','#00ffd0','#cccb00','#5382ff','#2ec2ff','#ca001e'];
    var tem = 0;
    sessionStorage.setItem("projectObj",JSON.stringify(resObj));

    for (var  key in resObj){
        var temObj2;
        debugger
        if (key === "路驰分公司") {
            temObj2 = {name: key, value: 0,colors:'#3badfc',total:0}
        }else {
            temObj2 = {name: key, value: (90 + (200/(tem + 1))),colors:colourArry[tem],total:totalArray[tem]};
            tem++;
        }
        var temArray = [];
        var temObj1= {name: '路驰分公司'};
        temArray.push(temObj1);
        temArray.push(temObj2);
        BJData.push(temArray);

    }

    //渲染echars
    editMidChar(resObj,BJData);
}

